def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if level is not None:
        if isinstance(group_axis, MultiIndex):
            if is_list_like(level) and len(level) == 1:
                level = level[0]

            if key is None and is_scalar(level):
                key = group_axis.get_level_values(level)
                level = None

        else:
            if is_list_like(level):
                nlevels = len(level)
                if nlevels == 1:
                    level = level[0]
                elif nlevels == 0:
                    raise ValueError("No group keys passed!")
                else:
                    raise ValueError("multiple levels only valid with MultiIndex")

            if is_scalar(level):
                if obj.columns.name != level:
                    raise ValueError(
                        "level name {} is not the name of the index".format(level)
                    )
            elif level != 0:
                raise ValueError("level should be 0 with MultiIndex")

            level, key = None, group_axis

    if isinstance(key, Grouper):
        binner, grouper, obj = key._get_grouper(obj, validate=False)
        if key.key is None:
            return grouper, [], obj
        else:
            return grouper, {key.key}, obj

    elif isinstance(key, BaseGrouper):
        return key, [], obj

    if is_tuple := isinstance(key, tuple):
        if is_hashable(key):
            if key not in obj and set(key).issubset(obj):
                msg = (
                    "Interpreting tuple 'by' as a list of keys, rather than "
                    "a single key. Use 'by=[...]' instead of 'by=(...)'. In "
                    "the future, a tuple will always mean a single key."
                )
                warnings.warn(msg, FutureWarning, stacklevel=6)
                key = list(key)

    if not isinstance(key, list):
        keys = [key]
    else:
        keys = key

    # Handle grouping by columns
    if axis == 1:
        obj = obj.T

    groupings = []
    exclusions = []

    for gpr in keys:
        if isinstance(gpr, Grouper) and gpr.key is not None:
            exclusions.append(gpr.key)

        if not is_in_axis(gpr) or is_in_obj(gpr):
            raise KeyError(gpr)

        ping = Grouping(
            group_axis,
            gpr,
            obj=obj,
            name=gpr,
            level=level,
            sort=sort,
            observed=observed,
            in_axis=False,
        )

        groupings.append(ping)

    if len(groupings) == 0 and len(obj):
        raise ValueError("No group keys passed!")
    elif len(groupings) == 0:
        groupings.append(
            Grouping(Index([], dtype="int"), np.array([], dtype=np.intp))
        )

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, exclusions, obj
